import React from "react";
import "./style.css";
import chandra_mohan from '../images/avtar.png';
import { useState } from "react";
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Products from "./product";


function Myheader({items}) {

  const [count, setCount] = useState(0);

  const handleItemClick = () => {
    setCount(count + 1);
  };


  return (
    <>
      <Router>
      <div>
        <Switch>
          <Route exact path="/" component={Home} />
          <Route path="/about" component={About} />
          <Route path="/contact" component={Contact} />
          <Route component={NotFound} />
        </Switch>
      </div>
    </Router>

        <section className="header_wrapper">
        <div className="navbar">
          <div className="logo">
          <img src={chandra_mohan} alt=""/>
          </div>

          <ul className="menu_name">

              {items.map(item => {
                return <li key={item.id}><a href={item.link}>{item.name}</a></li>;
              })}


          </ul>
        </div>
       </section>
      <button onClick={handleItemClick} >btnss</button>


    </>
  );
}

export default Myheader;
